import React, {Component} from 'react';
import {Form,Button} from "react-bootstrap";

class Usun extends Component {
    render() {
        if(this.props.typ === "doks")
            return (
                <tr>
                    <td colSpan={4} ></td>
                    <td><Form.Control as="input" name="id" defaultValue={this.props.id}  readOnly  /></td>
                    <td><Button variant="outline-info" type="submit" className="dane"> OK </Button></td>
                </tr>

            );
        else if(this.props.typ === "tow")
            return (
                <div>
                    Dodawanie towaru
                </div>
            );
        else if(this.props.typ === "firms")
            return (
                <div>
                    Dodawanie firmy
                </div>
            );
        else if(this.props.typ === "mags")
            return (
                <div>
                    Dodawanie magazynu
                </div>
            );
        else if(this.props.typ === "dok")
            return (
                <div>
                    Dodawanie pozycji
                </div>
            );
    }
}

export default Usun;
